    # O(m*n) space
    def numDistinct1(self, s, t):
        dp = [[0 for _ in xrange(len(t))] for _ in xrange(s)]
        for i in xrange(len(s) + 1):
            # from s to t = '' all one-ways delete all
            dp[i][0] = 1 
        for i in xrange(1, len(s) + 1):
            for j in xrange(1, len(t) + 1):
                # from s[:i + 1] to t[:j + 1] we can:
                # 1. from all ways from s[0:i] to t[:j + 1], just delete one more s[i], then from s[:i] to t[:j + 1]
                # 2. from all ways from s[:i] to t[:j], if s[i] == s[j]
                dp[i][j] = dp[i-1][j] + dp[i-1][j-1] * (s[i-1] == t[j-1])
        return dp[-1][-1]
    # this solution should be derived by myself. but.

    # this is a very good solution cause only O(len(t)) space
    def numDistinct(self, s, t):
        dp = [0 for i in xrange(len(t) + 1)]
        dp[0] = 1
        for i in xrange(1, len(s) + 1):
            pre = 1
            for j in xrange(1, len(t)+ 1):
                # each former dp[j] value is from s[:i] to t[:j + 1]
                # then like above we just need to add all ways from s[:i] to t[:j], if s[i] == s[j]
                # all ways from s[:i] to t[:j] is last iteration's dp[j - 1]
                temp = dp[j]
                dp[j] += pre * (s[i - 1] == t[j - 1])
                pre = temp
            # print dp
        return dp[-1]
    # this is an amazing solution. This solution use the feature of dp equation that only use the left-top and top value in the 2-D matrix
    # then reduce the space by replace the old 1-D array. It is really nice
